#помогу #дизайнер #ищуработу #резюме
Привет! 👋 Меня зовут Дарья, и я графический дизайнер на фрилансе 

Создаю:
❍ Логотипы;
❍ Фирменный стиль;
❍ Дизайн упаковок;
❍ Листовки, афиши, постеры, плакаты;
❍ Этикетки, наклейки;
❍ Визитки, буклеты

Также занимаюсь оформлением книг и журналов, как создаю дизайн для книг, так и верстаю журналы, каталоги. 

Часть работ представлена в профиле, полное портфолио отправлю при личном общении.

Цена: дизайн печатной продукции по 500 руб; 
Логотип, фирменный стиль 1000 руб;
Вёрстка журнала 500 руб/разворот

Жду Вашего сообщения! :)

